import React from "react"

export default function Quiz() {

    fetch("https://opentdb.com/api.php?amount=5&type=multiple")
    .then((res) => res.json())
    .then((data)=> console.log(data.results[0].question))

    return (
        <div>
            Quiz
        </div>
    )
}
